import React from "react";
import ReactPlayer from 'react-player';
import { Row, Col } from "react-bootstrap";

function AboutZomIN() {
  return (
    <Row>
      <Col lg={8} md={10} className="justify-content-center my-3 mx-auto">
        <div className="ratio ratio-16x9">
          <iframe
            src="https://www.facebook.com/plugins/video.php?height=314&href=https%3A%2F%2Fwww.facebook.com%2FMYzomin%2Fvideos%2F283407816318145%2F&show_text=false&width=560&t=0"
            allowFullScreen="true"
          ></iframe>
        </div>
      </Col>
      <figure className="text-center my-2">
        <blockquote className="blockquote">
          <p className="fw-bold">
            "To bridge the gap between graduates and employers"
          </p>
        </blockquote>
        <figcaption className="blockquote-footer">ZOM-IN</figcaption>
      </figure>
    </Row>
  );
}

export default AboutZomIN;
